func maxProbability(n int, edges [][]int, succProb []float64, start int, end int) float64 {
	if n < 1 || len(edges) < 1 || len(succProb) < 1  {
		return 0
	}
	if len(edges) != len(succProb) {
		return 0
	}
	if start < 0 || start >=n || end < 0 || end >= n {
		return 0
	}
	
	posEdges := make([][]int,n)
	posProb := make([][]float64,n)
	t1 := time.Now()
	for i := 0; i< len(edges) ;i++  {
		posEdges[edges[i][0]] = append(posEdges[edges[i][0]],edges[i][1])
		posProb[edges[i][0]] = append(posProb[edges[i][0]],succProb[i])
		posEdges[edges[i][1]] = append(posEdges[edges[i][1]],edges[i][0])
		posProb[edges[i][1]] = append(posProb[edges[i][1]],succProb[i])

	}
	fmt.Println(time.Since(t1))
	if len(posEdges[start]) < 1  || len(posEdges[end]) < 1 {
		return 0
	}
	reachedMap := make(map[int]int)
	reachedMap[start] = 1
	reachedMaxMap := make(map[int]float64)
	max = 0
	t2 := time.Now()
	for i := 0; i < len(posEdges[start]) ; i++  {
		reachedMap[posEdges[start][i]] = 1
		reachedMaxMap[posEdges[start][i]] = posProb[start][i]
		dfs(posEdges,posProb,posEdges[start][i],end,reachedMap,posProb[start][i],reachedMaxMap)
	}
	fmt.Println("dfs cost :",time.Since(t2))
	fmt.Println("dfs result :",max)
	t3 := time.Now()
	max2 := bfs(posEdges,posProb,start,end)
	fmt.Println("bfs cost :",time.Since(t3))
	fmt.Println("bfs result :",max2)
	return max2
}
func dfs(posEdges [][]int,posProb [][]float64,start int,end int,reachedMap map[int]int,currProb float64,reachedMaxMap map[int]float64) {
	if len(posEdges) < 1 || len(posEdges) != len(posProb) {
		return
	}
	if currProb <= max || currProb < 0.00001 {
		return
	}
	if prob,ok := reachedMaxMap[start];ok {
		if currProb < prob {
			return
		}
	}
	if start == end {
		if max < currProb  {
			max = currProb
		}
		return
	}
	for i := 0; i < len(posEdges[start]) ; i++  {
		if _,ok := reachedMap[posEdges[start][i]];ok {
			continue
		}
		nextProb := currProb*posProb[start][i]
		if prob,ok := reachedMaxMap[posEdges[start][i]];ok {
			if nextProb > prob {
				reachedMaxMap[posEdges[start][i]] = nextProb
			}
		}else{
			reachedMaxMap[posEdges[start][i]] = nextProb
		}
		reachedMap[posEdges[start][i]] = 1
		dfs(posEdges,posProb,posEdges[start][i],end,reachedMap,nextProb,reachedMaxMap)
		delete(reachedMap,posEdges[start][i])
	}
}
func bfs(posEdges [][]int,posProb [][]float64,start int,end int)  float64{
	queue := make([]int,len(posEdges[start]))
	queueProb := make([]float64,len(posProb[start]))
	copy(queue,posEdges[start])
	copy(queueProb,posProb[start])
	//reachedMap := make(map[int]int)
	//reachedMap[start] = 1
	reachedMaxProbMap := make(map[int]float64)
	reachedMaxProbMap[start] = 1.0
	maxProb := 0.0
	for len(queue) > 0  {
		lenQueue := len(queue)
		lenQueueProb := len(queueProb)
		if lenQueue != lenQueueProb {
			return 0
		}
		for i := 0;i < lenQueue ; i++  {
			nextPos := queue[0]
			queue = queue[1:]
			nextProb := queueProb[0]
			queueProb = queueProb[1:]
			if len(posEdges[nextPos]) < 1 {
				continue
			}
			if nextProb <= maxProb || nextProb < 0.00001 {
				continue
			}
			if prob,ok := reachedMaxProbMap[nextPos];ok {
				if nextProb <= prob {
					continue
				}else {
					reachedMaxProbMap[nextPos] = nextProb
				}
			} else {
				reachedMaxProbMap[nextPos] = nextProb
			}
			if nextPos == end {
				if nextProb > maxProb {
					maxProb = nextProb
				}
				continue
			}
			for j := 0; j < len(posEdges[nextPos]) ; j ++  {
				queue = append(queue,posEdges[nextPos][j])
				queueProb = append(queueProb,posProb[nextPos][j]*nextProb)
			}
		}
	}
	return max
}